型式</b>：3ウェイ･バスレフ型(非防磁)<br><b>スピーカーユニット</b>：16cmコーン型ウーファーx2、13cmコーン型ミッドレンジ、3cmアルミドーム型ツィーター<br><b>再生周波数帯域</b>：32Hz～50kHz(-10dB)、～100kHz(-30dB)<br><b>インピーダンス</b>：6Ω<br><b>許容入力</b>：50W<br><b>最大入力</b>：200W<br><b>出力音圧レベル</b>：89dB/2.83V1m<br><b>クロスオーバー周波数</b>：450Hz、3.5kHz<br><b>入力端子</b>：バナナプラグ対応ネジ式(バイワイヤリング可)<br><b>外形寸法(幅x高さx奥行)</b>：270Wx1060Hx425Dmm(スタンド含む)<br><b>質量</b>：30.7kg<br><b>付属品</b>：スパイクx4、ナットx4、サランネットx1、取扱説明書<br><style type="text/css">
